import React from 'react'
import Posts from '../Posts/Posts'
import axios from 'axios';
import './Home.css'

export default class Home extends React.Component {


    render() {
        return (

            <main className="posts-container">
                <section className="home-container"></section>
                <div className="posts">
                <Posts /></div>
            </main>

        )
    }
}
